@Fists_N_Razors @OfBurningAngels @AsiaticDevilDog @BurnThemToAsh @HellsFireBurns @TwistedRebekah @TheHouseBurns @HomicidalHybrid @ErraticSibyl @PeakyTim @WhiskeyNWomen @SpitefulVillian @OldIrishConMan @DeadAuntPolly @fanged_spaniard @OfFanaticism @FugamArtifex @DirewolfPhantom @TheTeresaShelby Excuse me?

[Raising a brow, I wipe my wet hands on my jeans]

Surely that should be obvious, Nate? What Matt said in there was humiliating, whether it was meant to be a joke or not. Or did you not see how my face went the shade of a tomato? I can still feel my face burning.
